import React from 'react';
import PageLayout from '../../components/PageLayout';
import HeroSection from '../../components/HeroSection';
import { Link } from 'react-router-dom';

const VibrationalIntelligence = () => {
  return (
    <PageLayout>
      <HeroSection
        title="Vibrational Intelligence"
        subtitle="Explore the science of frequency, detox, and elevation"
        background="/videos/vibrational-main.mp4"
        isVideo={true}
      />

      <section className="max-w-4xl mx-auto mt-10 space-y-6 text-center">
        <p className="text-gray-300 text-lg">
          Vibrational Intelligence refers to the awareness and understanding of the subtle energy fields
          that influence our physical, emotional, and spiritual wellbeing. Everything in the universe emits a frequency,
          and by learning to align with higher vibrations and neutralize discordant energies, we cultivate
          vitality, clarity, and purpose.
        </p>

        <h2 className="text-2xl font-semibold text-white">Explore the Subsections:</h2>
        <div className="grid grid-cols-1 sm:grid-cols-2 gap-4 text-white">
          <Link to="/vibrationalintelligence/elementsenergy" className="bg-gray-800 p-4 rounded-xl hover:bg-gray-700">Elements & Energy</Link>
          <Link to="/vibrationalintelligence/frequencyrecalibration" className="bg-gray-800 p-4 rounded-xl hover:bg-gray-700">Frequency Recalibration</Link>
          <Link to="/vibrationalintelligence/j2eprotocol" className="bg-gray-800 p-4 rounded-xl hover:bg-gray-700">J2E Protocol</Link>
          <Link to="/vibrationalintelligence/productcompendium" className="bg-gray-800 p-4 rounded-xl hover:bg-gray-700">Product Compendium</Link>
          <Link to="/vibrationalintelligence/packaginglabels" className="bg-gray-800 p-4 rounded-xl hover:bg-gray-700">Packaging Labels</Link>
        </div>
      </section>
    </PageLayout>
  );
};

export default VibrationalIntelligence;
